// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Correct paths based on folder structure
import Dashboard from './components/Dashboard';  // Ensure this path is correct
import ManageHome from './components/Home_Page';  // Ensure this path is correct
import ManagePortfolio from './components/ManagePortfolio';  // Ensure this path is correct

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Main Dashboard Route */}
        <Route path="/" element={<Dashboard />} />

        {/* Route for Manage Home page */}
        <Route path="/Home_page" element={<ManageHome />} />

        {/* Route for Manage Portfolio page */}
        <Route path="/manage-portfolio" element={<ManagePortfolio />} />

        {/* Add more routes for other components if needed */}
      </Routes>
    </Router>
  );
};

export default App;
